import React from "react";

const withTimestamp = (Component) => {
  return (props) => {
    const date = new Date();
    return (
      <div>
        <Component {...props} timestamp={date.toLocaleString()} />
      </div>
    );
  };
};

export default withTimestamp; // Export the withTimestamp function as the default export
